            <p class="mb-4">Neden mi 17? anakkalenin plaka kodu 17 olduu iin burada her eyin adnda bir ekilde 17'yi grmek mmkn. Yer yer On Yedi, zaman zaman On7, bazen dmdz 17, bazense 10 Yedi eklinde.</p>
            
